import "./Footer.css";
import React from "react";
import { Col, Row } from "react-bootstrap";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faLinkedin } from "@fortawesome/free-brands-svg-icons"

const Footer = ({}) => {
  var d = new Date();
  var year = d.getFullYear();
  return (
    <div className="footer">
      <Container>
      <Row>
        <Col>
          <h4>Connect With Me</h4>
          <a href="https://www.linkedin.com/in/finlay-goff-602779132/" target="_blank">
            <FontAwesomeIcon icon={faLinkedin} className="ml-2" />
          </a>
        </Col>
        <Col>
          <h4>About Me</h4>
        </Col>
        <Col>
          <h4>Navigate</h4>
          <Row>
            <Col>
              <Row><a>Projects Summary</a></Row>
              <Row><a>Education</a></Row>
              <Row><a>Experience</a></Row>
              <Row><a>Skills</a></Row>
              <Row><a>Achievements</a></Row>
            </Col>
            <Col>
              <a>All Projects</a>
            </Col>
          </Row>
        </Col>
      </Row>
      </Container>
      <p className="copyright">&copy; {year} Finlay Goff. All rights reserved.</p>
    </div>
  );
};


export default Footer;
